window.bookSummaryJSON = "<p><b>2020 NYPL Best Books of the Year&nbsp;</b><br> <b> 2020 Oprah.com Best Books of the Year&nbsp;</b><br> <b> 2020 NPR Best Book of the Year&nbsp;</b><br> <b> 2020 Amazon.com Best Books of the Year&nbsp;</b><br> <b> 2020 </b><b><i>Kirkus Reviews</i></b><b> Best Books of the Year</b><br> <b> 2021 Locus Awards - Nominee</b><br> <b> 2020 Barnes and Noble Best New Books of the Year &nbsp;</b></p> <p><b>\"[Narrator Julia] Whelan's performance is unforgettable in this darkly romantic fantasy about one young woman cursed always to be forgotten.... Her depiction of the darkness is smooth with a low cadence, capturing listeners' attention and their heart strings.\" (</b><b><i>Booklist</i></b><b>)</b></p> <p><b>In the vein of </b><b><i>The Time Traveler’s Wife </i></b><b>and </b><b><i>Life After Life</i></b><b>,</b><b><i> The Invisible Life of Addie LaRue </i></b><b>is </b><b><i>New York Times</i></b><b> best-selling author V. E. Schwab’s genre-defying tour de force.&nbsp;</b></p> <p><b>A life no one will remember. A story you will never forget.</b></p> <p>France, 1714: In a moment of desperation, a young woman makes a Faustian bargain to live forever - and is cursed to be forgotten by everyone she meets.</p> <p>Thus begins the extraordinary life of Addie LaRue and a dazzling adventure that will play out across centuries and continents, across history and art, as a young woman learns how far she will go to leave her mark on the world.</p> <p>But everything changes when, after nearly 300 years, Addie stumbles across a young man in a hidden bookstore and he remembers her name.</p> <p><b><i>NEW YORK TIMES </i></b><b>BEST SELLER</b><br> <b><i>USA TODAY </i></b><b>BEST SELLER</b><br> <b> NATIONAL INDIE BEST SELLER</b><br> <b><i>THE WASHINGTON POST</i></b><b> BEST SELLER</b></p> <p><b>A Macmillan Audio production from Tor Books&nbsp;</b></p> <p><b>\"This epic story, spanning three centuries and two continents, is expertly narrated by Julia Whelan.... This is a transporting listen, and these characters will stick with you for a long time.\" (</b><b><i>Bookpage</i></b><b>, starred review)</b></p>"; 
